          <StyledImg src={src} width={2000} height={834} />
    );
 }; */

 export const ProductImg = styled.div`
 background-image:
 `

 export const ProductContainer = styled.div`
 padding:200px 0;
 `;

 export const ProductWrapper = styled.div`
 margin: 0 auto ;
 width: 50%;
 `;

 export const Producth3 = styled.h3`
 font-size: 18px;
 color: #fff;
 font-weight:300;
 `;

